const Blog = () => {
    return (
        <div className="blog-container">
            <div className='blog-header'>
                <img src={blogPic} alt='Blog Header'/>
                <h1>TITLE HERE</h1>
                <h4>Published by: AUTHOR HERE  <span class="secondary-text">Secondary text</span></h4> 
            </div>
        </div>
    )

}

export default Blog
